import React, { useEffect } from "react"
import { deleteJobs } from "../utils/api"
import { useNavigate } from "react-router"

function Jobs ({ job }){
const navigate = useNavigate()
if(job){
   
      return (
      <>
         <ul>
            <li key={job.job_id}>
               <p className="listing">{job.neighborhood}</p>
               <img className="listing"  src={job.picture} alt="waiting"/>
               <p className="listing">{job.worker}</p>
               <p className="listing">{job.date}</p>
            </li>
            <button onClick={() => {
               deleteJobs(job, job.job_id)
               .then(navigate('/jobs'))
               .then(useEffect(loadJobs, []))
            }}>
            Delete
            </button>
         </ul>
      </>
         )}else{
            return(
               <><div>No Job Listed?</div></>
            )
         }    
}
    export default Jobs
